@TeamEFCoaching’s newest addition needs no introduction. The team's resident mountain man is fascinated and completely “obsessed with racing” – and can’t wait to share what he’s learned over the years with others.

“The speed, tactics, metrics and emotions that went into every race fascinated me and that gave me the fuel to work my way up the ranks. At the age of 15, I begged Jonathan Vaughters to give me a spot on the development team and — with the exception of a "study abroad" year in 2008 with the French team Vélo Club La Pomme Marseille — I've been with the Ride Argyle squad ever since.”

Learn more about Alex Howes and our other Team EF Coaching staff at the link in our bio.
